import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { fetchVehicles } from '../api/vehicleApi'; // Adjust this import based on your actual file structure
import '../styles/VehicleStyles.css';

function VehicleListPage() {
  const [vehicles, setVehicles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const loadVehicles = async () => {
      try {
        setLoading(true);
        const data = await fetchVehicles();
        setVehicles(data);
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch vehicles. Please try again later.');
        setLoading(false);
      }
    };

    loadVehicles();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="vehicle-list-page">
      <h1>Vehicle Management</h1>
      <Link to="/add-vehicle" className="btn btn-primary mb-3">
        Add New Vehicle
      </Link>
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Name</th>
            <th>Type</th>
            <th>Plate Number</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {vehicles.map(vehicle => (
            <tr key={vehicle.id}>
              <td>{vehicle.name}</td>
              <td>{vehicle.type}</td>
              <td>{vehicle.plateNumber}</td>
              <td>{vehicle.status}</td>
              <td>
                <Link to={`/edit-vehicle/${vehicle.id}`} className="btn btn-sm btn-info mr-2">Edit</Link>
                <button className="btn btn-sm btn-danger">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default VehicleListPage;
